import React from "react";
import AppLayout from "../components/AppLayout";
import SignupComponent from "../components/Signup"
const Signup = () => {
  return (
    <>
      <AppLayout> 
        <SignupComponent/>
        <div>Sign up</div>
      </AppLayout>
    </>
  );
};

export default Signup;
